  `product_type` varchar(32) DEFAULT NULL COMMENT '产品类型',
  `product_type_money` decimal(13,2) NOT NULL COMMENT '金额,单位元',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=49 DEFAULT CHARSET=utf8;

