  `pay_type` tinyint(1) NOT NULL COMMENT '付款方式1现金，2转账',
  `pay_bank` varchar(64) NOT NULL COMMENT '打款银行',
  `pay_name` varchar(128) NOT NULL COMMENT '打款名称',
