  `type` smallint(4) NOT NULL COMMENT '1系统消息 2用户消息 3任务消息 4CRM 5知识库',
  `sub_type` smallint(4) NOT NULL COMMENT '子分类',
  `send_uid` int(10) unsigned NOT NULL COMMENT '用户id',
