DROP TABLE IF EXISTS `guguo_take_cash`;
CREATE TABLE `guguo_take_cash` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `userid` int(10) unsigned NOT NULL COMMENT '用户id',
  `take_type` tinyint(4) unsigned NOT NULL COMMENT '交易类型 1:充值,2:提现,3转账,4:红包,5:任务,6:打赏',
  `take_type_sub` tinyint(4) DEFAULT NULL COMMENT '子类型,1:工作圈打赏,2:任务打赏,3:话术库打赏,4:直播打赏,5:发起任务,6:参与任务,7:任务奖励,8:发起任务退回,9:参与任务退回,10:猜输赢,11:猜输赢退回,13:任务打赏退回',
  `take_id` varchar(32) NOT NULL DEFAULT '0' COMMENT '交易关联id',
  `pay_type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '充值或提现的对端类型 1:支付宝,2:微信',
  `pay_account` varchar(128) DEFAULT NULL COMMENT '充值或提现的对端账号',
  `money_type` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '金额类型,1:个人,2:公司',
  `take_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1取出,2存入 ',
  `take_money` int(11) NOT NULL COMMENT '变动的金额：单位分, 存入正值，取出负值',
  `took_time` int(10) unsigned NOT NULL COMMENT '取钱时间',
  `order_number` varchar(40) DEFAULT NULL COMMENT '订单号',
  `fine_time` int(10) unsigned DEFAULT NULL,
  `to_userid` int(10) unsigned DEFAULT NULL COMMENT '内部用户转账时，收款人id',
  `from_userid` int(10) unsigned DEFAULT NULL COMMENT '收到转账时，来源用户id',
  `remark` varchar(128) DEFAULT NULL COMMENT '备注',
  `status` tinyint(1) unsigned NOT NULL COMMENT '处理状态,0处理中,1成功,2失败',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=240970 DEFAULT CHARSET=utf8;

