-- View structure for guguo_view_employee_task
-- ----------------------------
DROP VIEW IF EXISTS `guguo_view_employee_task`;
CREATE ALGORITHM=UNDEFINED DEFINER=`xzm`@`%` SQL SECURITY DEFINER VIEW `guguo_view_employee_task` AS select `et`.`id` AS `id`,`et`.`task_name` AS `task_name`,`et`.`task_start_time` AS `task_start_time`,`et`.`task_end_time` AS `task_end_time`,`et`.`task_take_start_time` AS `task_take_start_time`,`et`.`task_take_end_time` AS `task_take_end_time`,`et`.`task_type` AS `task_type`,`et`.`task_method` AS `task_method`,`et`.`content` AS `content`,`et`.`public_to_take` AS `public_to_take`,`et`.`public_to_view` AS `public_to_view`,`et`.`like_count` AS `like_count`,`et`.`tip_count` AS `tip_count`,`et`.`reward_count` AS `reward_count`,`et`.`reward_max_num` AS `reward_max_num`,`et`.`create_employee` AS `create_employee`,`et`.`create_time` AS `create_time`,`et`.`status` AS `status`,`e`.`telephone` AS `telephone`,`e`.`truename` AS `truename`,group_concat(`ee`.`truename` separator ',') AS `public_to_truename`,group_concat(distinct `etg`.`guess_employee` separator ',') AS `guess_employees`,`etr`.`reward_amount` AS `reward_amount`,`etr`.`reward_num` AS `reward_num`,`etr`.`reward_type` AS `reward_type`,`etr`.`reward_method` AS `reward_method`,`etr`.`reward_start` AS `reward_start`,`etr`.`reward_end` AS `reward_end`,`etr`.`ranking` AS `ranking`,`etr`.`re_amount` AS `re_amount`,`etr`.`re_amount_min` AS `re_amount_min`,`etr`.`re_amount_max` AS `re_amount_max`,`ett`.`target_type` AS `target_type`,`ett`.`target_customer` AS `target_customer`,`ett`.`target_description` AS `target_description`,`ett`.`target_num` AS `target_num`,`ett`.`target_method` AS `target_method`,if(isnull(`etc`.`comment_count`),0,`etc`.`comment_count`) AS `comment_count`,if(isnull(`ettt`.`partin_count`),0,`ettt`.`partin_count`) AS `partin_count`,`ettt`.`take_employees` AS `take_employees`,`gc`.`customer_name` AS `customer_name`,`vett`.`tip_employees` AS `tip_employees`,`vett`.`tip_moneys` AS `tip_moneys` from (((((((((`guguo_employee_task` `et` left join `guguo_employee` `e` on((`e`.`id` = `et`.`create_employee`))) left join `guguo_employee` `ee` on(find_in_set(`ee`.`id`,`et`.`public_to_take`))) left join `guguo_view_employee_task_reward` `etr` on((`etr`.`task_id` = `et`.`id`))) left join `guguo_employee_task_target` `ett` on((`ett`.`task_id` = `et`.`id`))) left join `guguo_customer` `gc` on((`ett`.`target_customer` = `gc`.`id`))) left join `guguo_view_employee_task_comment` `etc` on((`etc`.`task_id` = `et`.`id`))) left join `guguo_view_employee_task_take` `ettt` on((`ettt`.`task_id` = `et`.`id`))) left join `guguo_view_employee_task_tip` `vett` on((`vett`.`task_id` = `et`.`id`))) left join `guguo_employee_task_guess` `etg` on((`etg`.`task_id` = `et`.`id`))) group by `et`.`id` order by `et`.`id` desc ;

